import React from 'react';
import ReactDOM from 'react-dom';

import Heading from './Heading';
import Paragraph from './Paragraph';

ReactDOM.render(
    <>
       <Heading />
       <Paragraph />     

       <ol>
           <li>Kavya</li>
           <li>Shah</li>
           <li>Jignesh</li>
       </ol>
    </>    
      , 
      document.getElementById("root") );
